import React, { Component } from 'react';
import ReactTable from "react-table";
import "react-table/react-table.css";

class Data extends Component {

  render() {
    const data = [{
      title:  "Hello",
      des: 26,
      lang: '',
      creat: '',
    },{
      title: 'Sam Thomason',
      des: 22,
      lang: '',
      creat: ''
    },{
      title: 'Michael Jackson',
      des: 36,
      lang: '',
      creat: ''
    },{
      title: 'Samuel Roy',
      des: 56,
      lang: '',
      creat: ''
    },{
      title: 'Rima Soy',
      des: 28,
      lang: '',
      creat: ''
    },{
      title: 'Suzi Eliamma',
      des: 28,
      lang: '',
      creat: ''
    }]

    const columns = [{
      Header: 'Title',
      accessor: 'title',
      cell: e =><a href={e.value}> {e.value}</a>
    },{
      Header:  e =><a href={e.value}> {e.value}</a>,
      accessor: 'des',
      sortable: false
    },{
        Header: 'Language',
        accessor: 'lang'
    },{
        Header: 'Created at',
        accessor: 'creat'
    }]

    return (
          <div>
          <h2> My Github Repositories</h2>
              <ReactTable
                data={data}
                columns={columns}
                defaultPdesSize = {3}
                pdesSizeOptions = {[3, 6]}
              />
          </div>      
    )

  }
}


  export default Data;
